import React from 'react'

function LoginInputComponent({handleChange, text, name, type, placeholder, classInput, classLabel, classDiv}) {
    return (
        <div class={classDiv}>
            <label class={classLabel}>{text}</label>
            <input  type={type} 
                    name={name}
                    placeholder={placeholder}
                    class={classInput} 
                    onChange={handleChange}
                />
        </div>
    )
}

export default LoginInputComponent
